import { useEffect } from 'react';
import { Logo1 } from "./components/Picture1.jpg";

function Logo() {
  return (
    <div>
      <img src={Logo1} alt='logo'/>
      <p>crafto</p>
    </div>
  );
}

export default function Navbar() {
  return(
    <Logo/>
  )
};
